INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12191','817','143','1273','3/20/13 12:00:00 AM','20','Email','Senyah, the site rep stated that Rebekkah finished her hours last week: Rebekkah finished her hours last week by basically coming in back-to-back, which worked fine for us. She was an absolute pleasure and based on the long hours she was putting in each time she came, she was able to be really helpful with some of our membership and other administrative duties. ','Winter 2013',null,null,null);
