INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12189','1214','145','1356','3/20/13 12:00:00 AM','0','Email','Hi Katharine,  Thank you! I hope you enjoyed your service. Please be sure to submit a copy of your service hours to your professor. Have a great spring break as well.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12188','1214','145','1356','3/20/13 12:00:00 AM','15.5','Email','Hi Caity,      I have finished my hours and my service site coordinator has submitted my hours to the Steans Center.  I thank you for all of your help this quarter and hope you have a great break.  Let me know if you need anything else from me! Katharine','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12187','1214','145','1357','3/20/13 12:00:00 AM','0','Email','Hi Hannah,  As long as the sire rep communicated that with your professor and that is okay with them then you should be fine. Thanks! Enjoy your spring break.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12186','1214','145','1357','3/20/13 12:00:00 AM','0','Email',' Hi Caity,  The site representative from the CDC sent an email confirming my hours. Professor Gonzales told our class that would be ok, is that wrong? Demond Drummer sent an email yesterday, I can forward it to you if you need it as well.  Thanks, Hannah Friedlich    Sent from my iPhone','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12185','1131','181','1373','3/20/13 12:00:00 AM','0','Email','Hi Katie,  Sounds good. Also, you should have been getting your hours signed off on by your site rep each time you went in for service.   Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12184','1131','181','1373','3/20/13 12:00:00 AM','0','Email','I actually am finished I didn''t get my 20 hours but my teacher let me make it up with an assignment. Are you the one who is supposed to sign my hours? If not it is fine I am getting another copy  signed by the person I volunteered with. I just wasn''t sure whose signature I was supposed to get but just incase I will attach my hours.  Thanks,  Katie Guare','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12183','1214','145','1356','3/20/13 12:00:00 AM','0','Email','Hi Katharine,  No problem, good to hear that you are wrapping things up.  Please let me know when you complete the remaining hours.  Thanks.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
