INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12025','1042','150','1387','3/19/13 12:00:00 AM','0','Email','No need to email me the form, but thank you!  Also I''m very glad that you really enjoyed doing service as a PAA.  It was a pleasure hearing updates from you throughout the quarter!  I wish you good luck on the rest of your finals and I hope you have a wonderful spring break.   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12024','1042','150','1387','3/19/13 12:00:00 AM','0','Email','I will also email you my filled out form for PAA if you would like?   PAA was amazing, I was there for four hours today and another hour yesterday so with PAA I am at 19 hours (not that it matters). The people there are really so kind. Everyone is always laughing and joking. I really enjoyed it and felt fulfilled working with the members and employees. That is why I will still be going back whenever I can.  Thank you Kenneth for all your help and check ins','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12023','1042','156','1413','3/19/13 12:00:00 AM','0','Email','It''s understandable.  I''ve marked you down for a total of 21 hours.  Once you finish up the final 4 send me an email so I can mark you down for completion.   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('12022','1042','156','1413','3/19/13 12:00:00 AM','6','Email','Hi Kenneth,   Sorry for the delay; I have been very busy and this email got lost in everything else.   I am now at 21 hours, and just need 4 more to go. I am expecting to complete these hours this coming week.   -Dimitri','Winter 2013',null,null,null);
