INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11984','953','178','1295','3/18/13 12:00:00 AM','0','Email','Sent him the following: Hello,  Please send me an update on any service hours or final service hours that you have completed.  Also, include your experience at the site.  If you have any suggestions, please include what could have improved your service -learning experience.  Thanks','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11983','606','171','1322','3/18/13 12:00:00 AM','0','Email','Hi Corey,  Thanks, I imagine you''ll be finishing up the rest of your hours this week so just let me know when you have those all complete. Good luck with your finals!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11982','606','171','1322','3/18/13 12:00:00 AM','10','Email','Hi Caity,  Here are my hours for the past couple weeks!   Feb. 20th-3 hours in the community kitchen, serving people once they came in and sat down.  Feb. 27th-3 hours in the community kitchen, again, serving people dinner.  March 10th-4 hours- Northside P.O.W.E.R meeting in Rodgers park  Thanks!  Corey','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11981','1214','145','1357','3/18/13 12:00:00 AM','0','Email','Hi Hannah,  You should be getting your hours sheet signed each time you go to CDC. You have to turn that into your professor and that will show that you''ve completed all of your hours and tasks.  Let me know if you have any other questions, good luck with your finals!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11980','1214','145','1357','3/18/13 12:00:00 AM','15','Email','Hi Caity,  I have completed the hours and all my tasks with the CDC. I have a final meeting with Demond Drummer tomorrow just to make sure we are all set, but last Friday we discussed it and were in agreement that my hours were completed. Just in case he doesn''t know, who should Demond contact to tell I completed the hours and tasks?  Thanks, Hannah Friedlich','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11979','1131','181','1369','3/18/13 12:00:00 AM','0','Email','Hi John,  That''s great to hear! I''m glad you enjoyed your service. Good luck with finals!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11978','1131','181','1369','3/18/13 12:00:00 AM','3','Email',' Hi Caity, Just letting you know that I finished my hours last Friday the 15th. It was a great experience and I hope that I can do it again, perhaps for my graduation requirement. Sincerely, John Palmer','Winter 2013',null,null,null);
