INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11964','1212','150','1349','3/18/13 12:00:00 AM','15.5','Email',' Hi Caitlin,  I must have missed your voicemail. Sorry about that. I actually have gone two more times since my last email.  Here is a list of all my visits thus far:      1/14: 40 minutes - Orientation     1/25: 3.5 hours - Brainstormed ideas and structure for Spring Break conference. Got to know the kids that go to the center.     2/1: 1 hour - Went over possible formats and structure for the conference.     2/15: 4.5 hours - Went through possible setups, the planning partners, sponsors, and workshop leaders for the conference. Also went through possible venues.     2/19: 3.5 hours - Talked about possible sponsors and other people who could help out with the conference.     2/28: 3.5 hours - Helped decorate for black history month program. Helped the kids get ready for their performance.     3/12: 3.5 hours - Played with kids and helped with homework   Total: 20 hour 10 min  Let me know  if you need anything else!  -Steph','Winter 2013',null,null,null);
