INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11877','640','164','1429','3/18/13 12:00:00 AM','0','Email','I have completed 20 hours at Because I Care on Mondays.  Bailey Gardner ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11876','872','180','1518','3/18/13 12:00:00 AM','7','Email','Hello Jeremy,  This is Ivette, i was just letting you know that I have completed the 25 hours for the quarter.  Ivette enriquez   Sent from my iPhone','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11875','872','180','1517','3/18/13 12:00:00 AM','6','Email','Hello,  I have completed 22 hours since Friday, the 8th. I will finish it up on next week Monday or Tuesday. The last time I went in, I had conversations with two boy, Jamal and Brian. Brian was a senior in high school and he had general questions about college and psychology because he was interested in that. Jamal and I had a conversation about what school life has been for him since he returned from suspension. ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11874','872','180','1516','3/18/13 12:00:00 AM','6','Email','Hey Jeremy,  I can''t believe this quarter is quickly coming to an end. I had such an amazing time doing service at IEI and I wouldn''t trade it for the world. I completed a total of 25 hours this quarter. On March 9th, I went to a job fair for the kids and picked up a ton of information for them as well as sat down and spoke with a multitude of individuals there some of which were teenagers from different parts of Chicago. The total amount of hours I did service that day was 6 hours. Thank you for checking in every week. I hope you make it through finals with flying colors.   Best,  Vanessa Vicens','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11873','702','170','1520','3/18/13 12:00:00 AM','4','Email','Hello Jeremy,  I have completed the required 25 hours for my course and have submitted my signed yellow sheet to Professor Strain.  Wale Afolayan','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11872','702','185','1511','3/18/13 12:00:00 AM','3','Email','Jim Niemiec. I have completed 25 hours exactly. I acquired knowledge of the police treatment of minorities in Englewood and the various issues and tribulations that accompany such treatment. I spent most of my time talking and listening to people who have had crimes committed against them. ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11871','702','175','1502','3/18/13 12:00:00 AM','2','Email','Hello,  I have completed my 25 hours of service learning with the Chicago Alliance Against Racist and Political Repression, under the supervision of Ted Pearson, for the PHL250 course. My information is as follows:  1. Jeffrey R. Hastings 2. 25 hours 3. 1/18, 1/25, 2/1, 2/8, 2/22, 2/23, 3/1, 3/8, 3/15 4. Filing and organizing letters received from prisoners, responding to letters from prisoners, helping prepare for community events, participation in community event, making phone calls for events, preparing information packets, and general office-work  Thanks!  Best regards, Jeff Hastings ID: 1194049','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11870','702','175','1503','3/18/13 12:00:00 AM','23','Email','Katie McVeigh 30+ hours 03/14 Scanning letters, sending letters, transcribing information into spreadsheets, writing fact sheets on various cases, etc. ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11869','719','180','1582','3/15/13 12:00:00 AM','1','Email','student completed 25 hours of service','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11868','1205','162','1451','3/15/13 12:00:00 AM','0','Email','Hello Alexi,   I''m emailing to know how your project is going.  Send me an update when you get a chance.   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11867','720','150','1382','3/15/13 12:00:00 AM','0','Email','Thanks!  Since you were 5 minutes short I rounded up leaving you with 25 hours, which is your required amount.  When you go in on Tuesday shoot me an email.   Regards, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11866','720','150','1382','3/15/13 12:00:00 AM','5','Email','Hey Ken,  I was able to work out an arrangement and help out and join another group from a different service site so things have been made much easier. For this week I volunteered  3/12 1hr 50 minutes 3/14 3hrs 05 minutes  I plan to do one last day on Tuesday 3/19 to complete my hours and then continue volunteering on my own time to finish out the month of March that they had me scheduled for.    Cristina Sanchez','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11865','1042','150','1387','3/15/13 12:00:00 AM','0','Email','Thanks for sending the attachment as well.  I''ll mark you down for full completion.  Also I''m glad that you will continue to keep going to PAA.  For my final question.  How was your overall experience doing service there this quarter?   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11864','1042','150','1387','3/15/13 12:00:00 AM','17','Email','2018 Hi Ken,  At Pan African I am at 13 hours not 8 hours.  Also I am attaching the document with regards to my other long standing organization I volunteer with. BICC where I help keep up our Bosnian culture in the younger generations. This is a family organization but I wanted to devote my time else where as well.  I showed the document to my professor already but here it is for your records. Even though with this document I am finished with my hours I am going to Pan African today and Monday as well. I also may be going Tuesday or Thursday since I love the students and I feel I have been a real help to them.  Best,','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11863','817','143','1273','3/15/13 12:00:00 AM','0','Email','Sent the following email: Hi Smokey,  How is your service-learning going so far?  Please send me an update of the following:  1. Number of hours completed so far 2. Date acquired 3. Brief description of duties performed  Thanks,-- Also, sheprefers to be called Smokey ','Winter 2013',null,null,null);
