INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11843','872','180','1512','3/14/13 12:00:00 AM','4','Email','Hey Jeremy,  So the last I had updated you on February 25th, I had 22 hours complete. I finished my service hours this weekend but I will still probably be going to IEI... next weekend, hopefully I can still find people to go with me.  1. Emily Ramans 2. 4 hours complete (26 hours total) 3. Saturday, March 9, 2013 11am-3pm 4. I accompanied students to an internship fair at the Chicago Freedom School at 115 W. Chicago Ave. Different community organizations from around the city had representatives to tell youth about paid job opportunities and help them fill out applications. TRACE Chicago Park District, Public Allies, and many other organizations were there. We collected information to bring back to Jean and found out about some awesome groups that are providing sources of income for teenagers.   I have the yellow sheet of paper filled out but I was not sure if for advisor''s signature you were supposed to sign it or someone from IEI. Let me know if there is anything further I need to do','Winter 2013',null,null,null);
