INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11751','1167','165','1746','3/14/13 12:00:00 AM','0','Email','Hello Ladies,  This is your final check-in. I have talked to each of you personally and I know that you are probably not going to finish your hours before the quarter ends. As long as Dr. Amer is aware of this then you should be okay.  I just wanted to send one final email to see if you had any more hours to record for this week? I expect that this should serve as our last correspondence. I have enjoyed working with you, I am sorry that there was so much trouble getting things started with VIDA/SIDA in the beginning, but I hope that you ended up having a positive experience there!  Please let me know if you have anymore questions or if you have more hours to turn in!  Best of luck with finals, Molly','Winter 2013',null,null,null);
