INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11714','1168','180','1481','3/13/13 12:00:00 AM','6','Email','Hello,  I have completed a total of 26 hours but not all of them are from the Vietnamese Association. I have completed 3 hours at the St Joseph site which included orientation and an adult computer literacy class that I helped in once. I also did 5 hours at this women''s AIDS painting project that Hunter told me about. The rest of the hours I completed at Vietnamese :  2/5 completed 3 hours at Vietnamese site 2/12 completed 3 hours at Vietnamese site 2/19 completed 3 hours at Vietnamese site 3/1 completed 3 hours at Vietnamese site 3/5 completed 3 hours at Vietnamese site 3/8 completed 3 hours at Vietnamese site  I volunteered on all these days from 3 to 6. During my time at the site I would help the children with some questions that they had on their homework. I would also sometimes read with them or draw pictures and color with the younger ones, but most of the time I was helping with homework   Thanks Anjeanette Mendez','Winter 2013',null,null,null);
