INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11585','1215','167','1725','3/12/13 12:00:00 AM','0','Email','email to Cindy Larson (site partner for AHC) Hi Cindy,  I introduced myself a few weeks ago I am the Service Learning Coordinator for NSG 431. I just wanted to check in again we are going into our final week of the quarter here at DePaul, meaning that all of the students at Allied Health Care should have their service hours complete, or very close to complete!  I am including a list of the students who I oversee and the amount of hours they have told me that they have completed, just to verify with you that it is in fact correct!  Annette Kowalczyk: 3/15 hours Joanne Lam: 10/15 hours  If you would not mind looking over these names and hours briefly and confirming that they are accurate I would really appreciate it!!  All the best, Molly      CL:Molly,  Yes, it looks correct.  I understand with Anne that due to snowstorms, health and family stuff it has been difficult to complete the hours that were planned  However, we met and talked about some administrative projects that would be ver','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11584','1215','167','1724','3/12/13 12:00:00 AM','0','Email','email to Cindy Larson (site partner for AHC) Hi Cindy,  I introduced myself a few weeks ago I am the Service Learning Coordinator for NSG 431. I just wanted to check in again we are going into our final week of the quarter here at DePaul, meaning that all of the students at Allied Health Care should have their service hours complete, or very close to complete!  I am including a list of the students who I oversee and the amount of hours they have told me that they have completed, just to verify with you that it is in fact correct!  Annette Kowalczyk: 3/15 hours Joanne Lam: 10/15 hours  If you would not mind looking over these names and hours briefly and confirming that they are accurate I would really appreciate it!!  All the best, Molly      CL:Molly,  Yes, it looks correct.  I understand with Anne that due to snowstorms, health and family stuff it has been difficult to complete the hours that were planned  However, we met and talked about some administrative projects that would be ver','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11583','618','180','1564','3/11/13 12:00:00 AM','4','Email','NHH: Hey Molly,  I have done 23.5 hours overall, I did 4 hours of volunteer service last Thursday,and as usual I assists the youth in ACP After School Program. I still have 1.5 hours left,and I am planning to finish them this week.Hope you had a great weekend.:)  Nur Hafizah Hassan       MEM: Hi Nur,  That sounds great! Thank you for keeping me updated! I will send out a final email at the end of this week to collect final totals on hours, so just be looking out for that so that I can get a final count from you! Thanks for all of your heard work!  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11582','618','180','1685','3/10/13 12:00:00 AM','0','Email','RW: Molly, I am having trouble contacting my service site ACP, can you make sure I have the correct telephone number? 312 943 8530. This is the number I have used before to get a hold of them in the past but it seems as if they have changed it.  Reuben W.     MEM: Hello Rueben,   I just called the office, they said that they had talked to your yesterday, so hopefully everything is sorted out now? Were you able to schedule some more hours for this week?  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11581','946','167','1667','3/10/13 12:00:00 AM','4','Email','JK: 4 hours this week completing the initial prototype for the literature insert we''re working on. That should be 14.5 hours total, I THINK. Can you confirm? Jordan    MEM: Hi Jordan,  You are correct, you are at 14.5 hours! Thanks for checking in! I will be sending out a final email at the end of this week, just to check in about hours, so be looking out for that if you decide to go in again this week!  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11580','1154','145','1680','3/16/13 12:00:00 AM','4','Email','BM:  Hey Molly,  I was in this past Thursday 3/7 for three hours from 3:51 pm - 6:45 pm. Again I was working with the 8-9 year old group. This puts me at a total of 23.5 hours. If you have any other questions feel free to ask.  Best,   Billy Moening    MEM: Hi Billy,  That sounds great! Thanks for keeping me in the loop! I will send a final email at the end of this week to get final totals, so just be looking out for that!  Best of luck with this last week of classes, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11579','1167','165','1744','3/8/13 12:00:00 AM','0','Email','AW: Hey Molly, This week I couldn''t complete any hours due to doctor appointments and other commitments I had, but I do plan on doing possibly two days next week. I will let you know when I go and how many hours I completed. Thanks, Alexa     MEM: Alexa,  That sounds great! I will send out a final email at the end of this week, so like you said, just shoot me an email and let me know if you are able to get anymore hours done!  Thanks for keeping me updated!  All the best, Molly','Winter 2013',null,null,null);
