INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11387','618','180','1568','3/8/13 12:00:00 AM','0','Email','BC:  I have 20 hours, I have one more time to go which will be Tuesday and ill be Done .  Since last time we talked I did 5 hours.  During those hours we did collages     MEM: Hi Brittany,  That sounds great! If you want to send me an email Tuesday and let me know that you are done then you won''t get any more annoying emails from me!!  Hooray for being so close to finished!!  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11386','618','180','1685','3/8/13 12:00:00 AM','0','Email','RW: Hey Molly, I haven''t completed any hours since we spoke last. So far I have in total 6 hours, we have until the end of finals week to complete the hours, correct?     MEM: Hi Rueben,  Thanks for getting back to me. I thought you had done 8 hours total? Four hours on February 8th and then another four hours on February 15th? Will you get back to me and clarify that?  Whether you have until the end of Week 10 or the end of finals week to complete your hours is at the professor''s discretion so you will need to ask Professor Luhrs.  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11385','1167','189','1675','3/8/13 12:00:00 AM','6','Email','NC: Molly, This week I did 6 hours of condom packaging. I''ve reached 25 hours and am done. Thanks, Natalie      MEM: Hi Natalie,  I will get those 6 hours added in for you and you will be free of all my annoying emails! Thank you so much for all of your work this quarter, I hope you enjoyed your service experience!!  Best of luck with finals and have a great Spring Break!  -Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11384','623','167','1670','3/8/13 12:00:00 AM','5','Email','RA:  We were at the American Indian Center from 11-3  and brought home a video to upload to you tube and watch which was the history of the AIC (5 total hours).  We all should have completed our hours requirement with a total of 15 hours.  While we were there this week, we performed health screenings checking BP and Blood glucose.  We also assisted patrons to get acupuncture and cleaned the dining hall tables.      MEM: Hi Beck,  That sounds great! I will get those 5 hours added in from you and then you will be free from all my annoying emails!!  I will also need to have emails from the other girls, just to confirm with them that they are also finished. So if you want to reach out to them you are more than welcome to, otherwise I will just wait to hear from them!  I hope that you enjoyed the service experience!! Best of luck with your finals and have a great Spring Break!  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11383','1167','189','1675','3/8/13 12:00:00 AM','0','Email','Hello,  We meet again! This time it is Week 9 and you only have a couple of weeks left to get your hours completed! So please, let this be your last push to get them all done! This is a huge part of your grade and I would hate for someone to not do well in the class because they are missing service hours!    Please respond to this email and let me know-      How many hours you have since we last communicated:      What you have done during those hours:      How many hours you have completed total: This will help me to have the most accurate account of where you are at in the process of completing your hours.  It is essential that you email me back as reports will be going out to professors shortly.  I will look forward to hearing from you!  All the best, Molly','Winter 2013',null,null,null);
