INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11350','1167','189','1672','3/8/13 12:00:00 AM','0','Email','per RS: Molly, I will be finishing up with my last two hours tomorrow and I was wondering if all we have to do is turn in the signed time log and if so to who? Thanks, Ruth       MEM: Hi Ruth,  There are two parts to getting your hours completed. I need to have an email with the dates and times you were at VIDA/SIDA and what you did there during those hours. You are also going to need to turn in the time log to your professor. Your professor will use that time sheet and then the reports from our office to give you credit for the class.  Thanks for checking in, I will look forward to hearing from you!  All the best, Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11349','840','183','1474','3/8/13 12:00:00 AM','2','Email','8-March-13 student emailed me and informed me that she completed 2 hour this past wednesday. Her email: Hours this week: Wednesday (March 6th) ~ 3-5pm. Thanks Isra!                                                             ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11348','1042','168','1399','3/7/13 12:00:00 AM','0','Email','I''ve marked you down for full completion!  Since the quarter is almost over and you''re done with hours I''ll ask you my concluding question.  How was your overall experience during service and did it relate to the ideas talked about in class?   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11347','1042','168','1399','3/7/13 12:00:00 AM','15','Email','Yes, my professor said it was alright!  Peace and blessings, Danielle J. Russell','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11346','1026','169','1364','3/7/13 12:00:00 AM','0','Email','Michael,  No problem, thanks for letting me know. I hope you enjoyed your service this quarter! Best of luck with finals.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11345','1026','169','1364','3/7/13 12:00:00 AM','17','Email','Hey Caity,   Sorry for the delay in respone. I have been very busy with finals approaching.   I have completed my service learning as of march 4th.   I have 26 hours in total.   All the best, Michael','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11344','606','170','1336','3/7/13 12:00:00 AM','0','Email','Hi Jesse,  When we spoke last week we discussed your hours and the possibility of you contacting Brittany from A Just Harvest so that you can schedule some more hours to meet the requirement. I just wanted to check in and make sure you were able to set that up with her. Please confirm with me that you have, and if for any reason you were not able to schedule some extra hours please let me know as soon as possible so that we can figure something out. Thanks Jesse, I look forward to hearing from you soon!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11343','1026','169','1364','3/7/13 12:00:00 AM','0','Email','Hi Michael,  I''m not sure if you got my voicemail last week, but either way I was hoping I could hear back from you about your service learning. If you could please let me know how many hours you''ve completed so far that would be great! Thanks so much, I look forward to hearing from you soon.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11342','1131','181','1367','3/7/13 12:00:00 AM','0','Email','Hey Jackie,  Last we spoke you only had about 6 more hours left to complete and I told you I''d check in with you this week to see how that''s going for you. Hope you''re still on track to completion, please let me know as of this week what your total hours are. Thanks, talk to you soon!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11341','1131','181','1368','3/7/13 12:00:00 AM','0','Email','Hi Paige,  I still haven''t heard back from you about your service with St. Vincent DePaul Center.  Again, I only have four hours in total recorded for you since we last spoke in January.  Since the end of the quarter is approaching we will be sending reports to your professor with your total hours and I want to make sure that before that happens I have your total number of correct hours recorded. Please update me as soon as possible with this information. Thank you very much, and I look forward to hearing from you soon.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11340','1042','150','1387','3/7/13 12:00:00 AM','0','Email','Thanks for the swift reply.  I''m glad that you have another way to get additional hours.  Since you will also be serving there please send me your hours when you go in to tutor.   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11339','1056','189','1762','3/7/13 12:00:00 AM','8','Email','I will have 20 hrs completed by Friday March 8th, and 25hrs by Saturday March 16th. ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11338','1042','150','1387','3/7/13 12:00:00 AM','0','Email',' Hi Ken,  I already spoke with him and there is a Bosnian Cultural Center I attend with my younger cousins and help tutor the younger generation in the Bosnian language. I told him I would give him a letter that I volunteer there and he said that will be fine. I will still work with PAA as scheduled for Friday and the following Mondays with the ESL course since I am doing my projects for the course there.   Thanks,','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11337','1131','181','1366','3/7/13 12:00:00 AM','0','Email','Hi Monika,  That''s great! Thanks for all of your cooperation this quarter. Good luck with the rest of the quarter and with finals.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11336','1131','181','1366','3/7/13 12:00:00 AM','3','Email','I''m done with my 20 hours of service learning!   Thanks, Monika Kurzac','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11335','1126','164','1621','3/7/13 12:00:00 AM','2','Email','8 hours Sent via BlackBerry from T-Mobile','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11334','1042','150','1387','3/7/13 12:00:00 AM','0','Email','Thanks.  I''ve updated you to 8 hours. Send me an another email when you finish your hours on Friday.  With service learning courses it is mandatory that you finish your hour requirement to pass the course.  Certain exceptions can be made, but you definitely would have to communicate with your professor.  Make sure to tell Professor Strain about your situation as soon as you can.   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11333','1168','180','1780','3/1/13 12:00:00 AM','0','Telephone','Called and left a VM asking for info in hours asap.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11332','1042','150','1387','3/5/13 12:00:00 AM','4','Email',' Hi Kenneth,   Yes I did the ESL class again yesterday for 2 hrs. 5:30 to 7:30 PM and currently I am in a computer course that will be going from 2PM to 4 PM since our classes got canceled. For a total of another 4 hours.   I will be at the organization as well this Friday working on a project starting at 9AM and then I will see until I will be there, but I will update you with that as well.   What happens if I am not able to complete all the 25 hours for the HON 351 course? I am really trying but with my 5 courses and the PAA''s volunteering schedule and me working it is very hard for me to find time despite my efforts.   Best, Melisa','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11331','720','150','1382','3/7/13 12:00:00 AM','0','Email','Thanks for the detailed response.  I''m glad that you will continue to do service with Chicago Metropolitan after your class is done.  As for your sign off sheet you should email Lilian to see if she or any other members can sign it for you.  In terms of your final project I can definitely see a lot of difficulty with it since the way your do service differs from most organizations.  You should communicate this with Professor Strain to see if he has any suggestions for what you could do about it.    Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11330','1168','180','1481','3/7/13 12:00:00 AM','0','Email','Hello Anjeanette,  I hope the quarter is going well for all of you, we are approaching the end of the quarter with less then 3 week to complet your service hours. I am contacting you to get an update on the number of hours you have acquired so far. Please respond to this message asap so I can inform you professor of your progress at your site. So far I have you down at 20 hours serviced  at Vietnamese Association.    Please emailing me, I need to know these 4 things:  Name / Site your volunteering at Total number of hours / with breakdown  Date acquired all hours Brief description of duties performed  Thanks in advance, ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11329','803','175','1593','3/7/13 12:00:00 AM','4.5','Email','Last week was four hours, so I should be at 17 hours right now. Sorry for the delay I was out of town.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11328','720','150','1382','3/7/13 12:00:00 AM','0','Email','The service has been great, it fits in with my schedule very easily and is accommodating when I have scheduling conflicts. I enjoy it very much and believe I will continue to provide service even after I fulfill my required hours. There are a couple issues however. No one from the organization has been in to sign off on my completed hours (or the hours of any of the other DePaul students volunteering). Also my HON 351 class requires me to do a final project in which I "leave a mark" at my location site by doing something for the organization location or its members. Unlike the other service sites that have their own location and interact with the people their site aims to help, my service takes place at the Cook County courthouse and I do not interact with the domestic violence victims at all. Court watching is a solitary activity so it has been difficult to deliver on what the class expects from me when my service does not function in the same way as the others.  Cristy','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11327','719','181','1691','3/7/13 12:00:00 AM','3','Email','My hours for this week are 15. I will email you another update next week, thanks!','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11326','1042','156','1400','3/7/13 12:00:00 AM','0','Email','That most certainly helps!  I''ve marked you down for a total of 20 hours.  What things have you guys been going over in the PAAWR meetings?   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11325','1042','156','1400','3/6/13 12:00:00 AM','7.5','Email','Hey Kenneth,   Sorry I didn''t get back to you before. I''ve been fairly busy with school and work the past couple weeks.   As far as hours, to my count I''ve got 20.   I think you''ve got count up through January and below is my involvement for February:  2/2 - 2 hours - PAAWR Meeting 2/9 - 2 hours - PAAWR Meeting 2/14 - 1 1/2 hours - Worked on details regarding a possible event at Ethiopian Diamond 2/16 - 2 hours - PAAWR Meeting  I hope this helps and I''ll make sure to fill you in on hours when I can.   Thanks!  -Scott','Winter 2013',null,null,null);
