INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11311','720','150','1383','3/7/13 12:00:00 AM','0','Email','Thanks.  I''ve updated your file to 14 hours.  Also you are correct.  Have the coordinator sign your time sheet when you''re there.  I look forward to your update tomorrow.   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11310','1126','164','1620','3/7/13 12:00:00 AM','0','Email','Molly,  I would go in and go talk to your professor instead of emailing her. There is no way that we could give you credit for half of the class.  As mentioned before you can do outside service and get approval from your professor. For example, you can go volunteer at a homeless shelter and as long as your professor approves it (which i hear she is extremely flexible so i don''t see it as being a problem) you will be able to use those hours.  Victoria Fonseca','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11309','1126','164','1620','3/7/13 12:00:00 AM','0','Email','Hello, I''ve been trying to talk to my teacher about this, but haven''t really gotten a response to my question. Is there any way that I can get credit for the class (simply as a Nutrition class) and just forfeit the service learning credit. I''ve had an extremely difficult time with this entire process and by the looks of it there is no way I will be able to fulfill the service requirements in the next two weeks.  -Molly','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11308','720','150','1383','3/7/13 12:00:00 AM','4','Email','I just completed 4  hours today from 9-1. I''ll be back tomorrow morning for another shift and I will email you as soon as its done with the duration. Also, should I have the coordinator here sign time sheets for me? ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11307','1042','156','1425','3/7/13 12:00:00 AM','0','Email','Thanks for the update.  I will continue to update your hours until winter quarter ends.  Do you plan in doing service any time soon?   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11306','1168','143','1314','3/7/13 12:00:00 AM','0','Email','Hey Michael,  I would recommend you talk to your professor and hopefully she can credit you with those hours that you would''ve worked when LePhuong was sick. If she won''t give you credit for those, then I would recommend you try to do as many hours as you can at Vietnamese as well as possibly finding his own site to work at to get up to the 25. Let me know how it goes.  Thanks,','Winter 2013',null,null,null);
