INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11146','1168','143','1314','3/5/13 12:00:00 AM','0','Email','1) Michael Randazzo Vietnamese association 2) 3 hours on February 6, 2013. I don''t know if orientation counts for hours but it was 30 min long on Janurary 15, 2013.    I went to the Vietnamese association on February 20 from 3:30 to 6 I helped kids with homework and watched them. I went to the Vietnamese association  on February 26 from 4 to 6 I helped kids with homework and watched them. Total of 8 hours. Plus I tried to get there when she canceled on feb 8 the total travel time was 1 hour there and 1 hour back.  If this counts than total 10 hours.  3) I watched the kids to make sure they are behaving along with helping the kids with homework  I been having trouble getting my hours since she was sick for 2 weeks earlier in the quarter feb 8th was also cancel. Than feb 10 and 11 was cancel and feburary 27 was cancel. There was a lot of days that is making it hard to get 25 hours in the 10 weeks we have. I have only a few more weeks and I am trying hard to get them all done.  What shoul','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11145','930','186','1677','3/5/13 12:00:00 AM','9','Email','Hi Steven  Here are the 4 things:  1. Latino Policy Forum / Mexican Consulate 2. 12 hours: 3 hours on February 1 (Orientation), 3 hours each on February 13, 20 and 27 (service at Mexican Consulate) 3. February 1, 13, 20 and 27 4. Give presentation on housing rights at the Mexican Consulate and one-on-one consultations with community members about their housing rights  Thank you,  Alex Dzik','Winter 2013',null,null,null);
