INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11143','1040','152','1715','3/4/13 12:00:00 AM','2','Email','Steve,   Per your request, I completed my 20 hours of volunteer service learning.  I have a signed letter from the PADS Volunteer Coordinator stating that I completed my 20 hours of volunteer service at the shelter.  I have timesheets from PADS that shows the dates listed below.  Should I scan and e-mail you the letter and timesheet?  Please advise at your earliest convenience.   When emailing me, I need to know these 4 things: Name / Site your volunteering at - PADS - Safe Haven in North Chicago, IL Total number of hours / with breakdown - I completed 20 hours.  (2/1/13) 2 hours, (2/4/13) 2 hours, (2/6/13) 2 hours, (2/8/13) 2 hours, (2/11/13) 2 hours, (2/15/13) 2 hours, (2/18/13) 2 hours, (2/20/13) 2 hours, (2/22/13) 2 hours, (2/25/13) 2 hours and (2/27/13) 2 hours. Date acquired all hours - 2/27/13.  Brief description of duties performed - I organized, shopped, create, prepare, delivered and served hot nutritious meals to the mentally ill residents at PADS - Safe Haven. Thank you,','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11142','1136','168','1393','3/2/13 12:00:00 AM','0','Email','Service has been going fine as usual. A little sad that one of the families I really had a chance to bond with, moved out of the house but I still have the other children I''m close with so. For the most part though service has been wonderful.   Brianna Vinson,','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11141','1172','169','1326','3/5/13 12:00:00 AM','11','Email','Olivia Tym, Voices for Creative Nonviolence So far, I have completed 23 1/2 hours. I will be going back tomorrow for the rest of the hours.  1/8, 30 mins 1/19, 1 hr 1/21, 3 hours 1/25, 4 hours 1/28, 4 hours 2/1, 4 hours 2/20, 4 hours 2/27, 3 hours  On most of the days, I helped out with various office assistance tasks and research for ongoing projects (primarily the Atrocities in Afghanistan project). I often helped organize spreadsheets, sent emails and thank you letters to contributors, and researched centers for nonviolence in the Middle East.','Winter 2013',null,null,null);
