INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11090','640','153','1484','3/4/13 12:00:00 AM','3.5','Email','Hi, Jeremy   Since my last update I have completed the 20.0 hour service requirement; please see the attached listing of hours.   Thank you!   Linda Davis','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11089','872','180','1513','3/4/13 12:00:00 AM','10.5','Email','Hello Jeremy,  I also apologize for the delay, I have been a bit swamped myself.   Feedback: IEi is a great organization providing ample opportunities to help an extremely disenfranchised community, though would benefit from more direction in terms of long term goals from leadership.   1. Matt Hartzell 2. 15 hours (total) 3. MOST RECENT DATES: 3/1 (5 hours), 3/2 (5.5 hours) 4. In most recent dates, aided in organization of documents and assisted in City Year led beautification/improvement project of the IEi center (painting murals, helping to organize community volunteers, general labor).','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11088','872','180','1517','3/4/13 12:00:00 AM','4','Email','Hello,  So far I have earned 16 credit hours. On Thursday of Last week I went to my service site. While there, I had a conversations with the children there. One of them shared his recent experience with "getting jumped" with me. He was suspended for fighting back. We identified ways he could try to avoid the problem of suspension the next time that problem came about. I helped with organization and moving things around for the new mirage going on the wall.  So far my volunteer experience have been interested. Going in, I was willing to give my all with the small amount of time I had over there. However, I quickly realized that the place was extremely disorganized. Sometimes kids do not show up and it is left with the volunteers planning and having meetings. But on my recent visit to the site, I had an eye opening experience during a conversation with one of the students there. He had gotten into trouble with some of the gang members in his community although he was not a gang member. ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11087','702','185','1507','3/4/13 12:00:00 AM','4','Email','Dear Jeremy,       Last week, I sent to you my current hour update. I forgot to mention one more day of petitioning on Saturday January 9th. We met on 69th street, split up into three groups with an alliance leader and petitioned through 63rd street. A total of four hours were accounted for. I''m at a total of 23 hours now.Thank you for taking the time to read this.   -Michelle Dochnal   (224) 425-3127','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11086','1131','181','1371','3/4/13 12:00:00 AM','0','Email','Hi Anna,  I just wanted to do another check in with you on your hours. Last we spoke you had completed 7 hours of service.  Please let me know how many hours you''ve completed since. Thanks, I look forward to hearing from you soon.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11085','1131','181','1374','3/4/13 12:00:00 AM','0','Email','Hi Jacelyn,  I am writing because I still haven''t received any information from you on your service hours. All that I have recorded is that you attended orientation in January, but I have no updates since to provide your professor with. Please let me know how many hours you''ve completed thus far. Thanks, I look forward to hearing from you soon.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
