INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('11079','606','171','1327','3/4/13 12:00:00 AM','0','Email','Hi Marley,  Thanks for getting back to me. I calculated about 13 hours from your email, can you verify that this is correct?  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
