INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10914','1126','143','1478','2/28/13 12:00:00 AM','0','Email',' Hello Everyone,  I hope you all had a great week and are looking forward to the weekend! I need to know as soon as possible how many hours you will have as of March 1, 2013.   It is very important that you email me with the number of hours.   For some of you I have a small number (below 10 hours). It is week 8 and we only have two more weeks of the quarter. At the end of this week we will be sending out a report to your professor. For a reminder your professor has the right to lower (or even fail) you for not communicating with me throughout the quarter.  If you have any questions or concerns please feel free to email me back.  Thanks,  Victoria','Winter 2013',null,null,null);
