INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10849','1126','164','1620','2/28/13 12:00:00 AM','0','Email','Hello Molly,  I am sorry you are having such a hard time with getting your hours done. You only have to do 10 more hours to get the completed hours done.   Something that could help is you can go to our website (steans.depaul.edu) and look at our calendar. We put up opportunities for you to get extra hours. You can go to a homeless shelter or tutor underprivileged children for extra hours. The only thing is you MUST get them approved by your professor.   If you could volunteer at a soup kitchen on the weekend and get it approved by your professor then I believe you could get those final 10 hours done.  let me know if I could help you with anything else.  Victoria','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10848','720','169','1569','2/28/13 12:00:00 AM','0','Email','That sounds very exciting!  I''m glad that you were able to have a unique experience.   Best, Ken','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10847','1126','164','1620','2/28/13 12:00:00 AM','10','Email','Hi Victoria,  I''m sorry I haven''t responded to your emails yet, I''ve been trying to work things out with my sight coordinators and with my professor in regards to my community service- with little success.   To date I have worked 10 hours of community service for this class.   I realize this is WAY too little for what I need for the course requirements. I took this class not because I needed a service learning class (I''ve already taken a service learning class and a separate experiential learning class), rather I took it because I wanted to be involved in more community service. I signed up for 3 1/2 hours of service at St. Joe''s on Mondays and Thursdays, hoping to get 7 hours a week. After the 4th week I learned that although they had me sign up for a Monday shift, there is no Monday shift, and on Thursday there is only an hour and a half shift. I''ve been trying to communicate with the service coordinator Beatrice but she has stopped responding to my emails altogether. I have no idea ','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10846','720','169','1569','2/26/13 12:00:00 AM','0','Email','Hi Ken,  My service has been going very well. The past couple of times I''ve gone to observe court I got to watch a couple bench trials which were really interesting. Most people don''t watch trials unless they are on CSI so it was very eye opening to see how the court proceedings happen in real life.  Thanks,  Ben','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10845','1126','164','1620','2/28/13 12:00:00 AM','0','Email','Hello Everyone,  I hope you all had a great week and are looking forward to the weekend! I need to know as soon as possible how many hours you will have as of March 1, 2013.   It is very important that you email me with the number of hours.   For some of you I have a small number (below 10 hours). It is week 8 and we only have two more weeks of the quarter. At the end of this week we will be sending out a report to your professor. For a reminder your professor has the right to lower (or even fail) you for not communicating with me throughout the quarter.  If you have any questions or concerns please feel free to email me back.  Thanks,  Victoria','Winter 2013',null,null,null);
