INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10798','702','185','1507','2/28/13 12:00:00 AM','10','Email','1. Michelle Dochnal 2. 19 hours 3. 1/12/13, 1/24/13, 2/2/13, 2/18/13, 2/23/13 4. On the day of orientation, we talked about what was the goal we were trying to acquire during these next few weeks. We go door to door and talk to people on the streets to sign a petition to get cops who abuse their power and brutalize innocent people''s rights. We went to many houses and talked with people. We passed out flyers and got signatures for the petition. We went to the Chicago Police Crimes Rally on the 23rd of Febuary at University of Chicago. We heard from real victims and cops the epidemic that was around us. I mainly cleaned, set up, and helped out any way I could.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10797','817','143','1282','2/28/13 12:00:00 AM','5','Email','contd','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10796','817','143','1282','2/28/13 12:00:00 AM','10','Email','She confirmed that she has completed her hours: Hello, Sorry about the confusion. So as where I am today, January 19th I did the orientation 1 hour, on the 26th I did 4.5 hours, on feb 2nd I did 4.5 hours, feb 9th I did 4.5 hours, feb 16th I did 5.5 hours, feb 23rd I did 5 hours. So technically I am done but I will be going back next Saturday for the last time for 4.5 hours. Thanks!','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10795','953','178','1404','2/28/13 12:00:00 AM','6','Email','She confirmed the following via email: Hi Arielle, I went both Tuesday and Thursday of last week for an hour and a half each time. Both days we played games with the kids. This week I went on Tuesday and I am going again today for an hour and half again. After today I will have 17.5 hours. Thanks, Leslie','Winter 2013',null,null,null);
