INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10725','1214','145','1357','2/27/13 12:00:00 AM','0','Email','Hi Hannah,  Sounds like Greater Englewood CDC has been keeping you busy with lots of stuff to do, which is great. I marked you at ten hours in our hour tracker system so please let me know next week how much further along in your service you are. Thanks!  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10724','1214','145','1357','2/27/13 12:00:00 AM','4.5','Email',' Hi Caitlin  I wanted to update you on my hours at the greater Englewood CDC. I am just under 10 hours as of today. I''ve done a lot of research, as well as phone and email correspondence with various people in efforts to find advertising space and opportunities for the CDC. We have also spent time going over updates and any new information that the site representative receives or has to report on, such as looking at their new logo, new ideas they have, etc. I plan on going in today after class for a couple hours, and have some time set aside throughout the week to do more work with and for them. I will update you again next week.  Thank you, Hannah Friedlich    Sent from my iPhone','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10723','1131','181','1376','2/27/13 12:00:00 AM','0','Email','Hi Daniel,  Thanks. No problem, glad the problem is resolved! I entered in 9 hours for you into our tracker system. Please continue to send me an email each week with an update on your hours. Thank you, talk to you soon.  Best,  Caity Delarosa Service Learning Coordinator Irwin W. Steans Center CDELARO1@DEPAUL.EDU','Winter 2013',null,null,null);
