INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10682','640','164','1429','2/26/13 12:00:00 AM','6.5','Email','1. Bailey Gardner 2. 22.5 3. Past 4 Mondays 4. Help with homework and reading.  This has been a very interesting experience.  My largest issue was the location of Because I Care.  It takes me well over and hour to get there by train/bus.  I took the train the first couple of times, but after being verbally harassed many times, I started taking a cab, which is very expensive.  It was worth it though because taking the bus by myself through Austin was a scary experience.  As for the organization, I enjoyed helping the kids.  They often finished their homework quickly so there wasn''t much for me to do besides hang out with them.  There is not a whole lot of organization at Because I Care, but the kids seem to enjoy being there. ','Winter 2013',null,null,null);
