INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10669','635','167','1705','2/27/13 12:00:00 AM','2.5','Email','  The student emailed me after we spoke on the phone: "I''m sorry I was so hurried earlier, I did not mean to be rude.  I have completed 3.25 hrs. (January 31st 2013), 3.5 (February 7th 2013), 5 hrs. (February 14th 2013).  The grand total so far is 11.75.  I am going back on Wednesday and Thursday this week.  Once again I apologize if I was too brief earlier, I was on my way to run an errand and I was on a mission.  Thank you for your time.   Margo  P.S.  I will have completed the required 15 hours by the end of the week.  I intend to continue volunteering with AHC, just so you know.  I don''t know if you still will need my hours updated regularly, but I will keep you in the loop just in case. "','Winter 2013',null,null,null);
