INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10665','640','153','1487','2/26/13 12:00:00 AM','0','Email',' Jeremy, I had previously submitted to you my service hours log.  I have attached it again for your reference.  Here are the details of my service.   1.        Because I Care 2.       20 ? hours of service 3.       See attached log 4.       I tutored children from preschool through grade 8 in math, reading and writing.   Overall it was a worthwhile experience.  I do want to note that the program needs more volunteers and volunteers who keep their commitments.  I think it might help for volunteers to understand before they go that it is not in any way like a structured school classroom.  The service requires flexibility as each day will be different.  If you are willing to commit and fulfill your service requirements, the benefits of the relationships you build with the students is well worth it.   ','Winter 2013',null,null,null);
