INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10435','872','180','1513','2/25/13 12:00:00 AM','0','Telephone','Called student and left a message with my contact info.','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10434','872','180','1512','2/25/13 12:00:00 AM','0','Email','Hi Jeremy, so before this past weekend, I should have had 17 hours completed. This saturday  went to IEI again.  1. Emily Ramans 2. 5 hours 11 am-4 pm 3. Saturday, February 23, 2013 4. I worked with Cecile Johnson on drafting a grant for a community center. In lieu of the CPS proposed school closing, community activist in Englewood met with the school board to try to compromise. The asked for schools with recent technology investments to remain open and in return for all the closures, that one of the schools to be donated as an Englewood Community Center. Cecile interviewed me for almost an hour on the history of race relations in Chicago and specific events that have caused Englewood to be in a state of distress. I also worked with a few of the students on homework and involved them in the search for ideas of how to raise funds for a new community center.  Thank you,  Emily Ramans','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10433','872','180','1516','2/25/13 12:00:00 AM','10','Email','Hi Jeremy,  My name is Vanessa Vicens and I have completed a total of 19 hours at IEI. I volunteered for 5 hours on Saturday, February 16th as well as 5 hours on Saturday, February 23rd. I did a lot of planning and organizing for upcoming events. I also had some really intentional conversations with the young women and men that were there. I''m truly enjoying my experience at IEI.   Best,  Vanessa Vicens','Winter 2013',null,null,null);
INSERT INTO ServiceHours(ID,CBO_ID,CourseID,StudentID,ServiceDate,HoursServed,ContactType,Notes,Quater_Year,EngagementDescription,MemberID,LastEditorID) VALUES('10432','872','180','1518','2/25/13 12:00:00 AM','6','Email','Hey Jeremy,  This is Ivette Enriquez from Imagine Englewood If..., on Saturday, February 16, I did 6 hours at the center, from 10am-4pm. That day we talked with a couple of kids that always go to the program. We talk to them about college, what they hope to be, their home life, their social life and we also addressed problems in their community that they would like to fix. Then we made a poster with Imagine Englewood If... On it and had them right if statements all around it.   I do enjoy going to help out the kids. They are all so nice and easy to talk to and they do get really close to you so I do enjoy that. The community isn''t the safest and it is sometimes scary to go, but I guess there really isn''t much to do about that. I do feel like they should e more organized. We have all contributed great ideas and I feel like the coordinators in the program liked them and were really eager to implement them but we never see them actually going trough with them.','Winter 2013',null,null,null);
